import React, { useEffect, useState } from "react";
import { Modal } from "../modalComponent/modalComponent";
import './checkOutModal.scss';
import Carrinho from "../carrinho/carrinho";

interface Props {
  isOpen: boolean;
  onClose: () => void;
  children: React.ReactNode;
  foodOptions: any[]; // Adicione a tipagem correta para a prop foodOptions
}

const CheckOut: React.FC<Props> = ({ isOpen, onClose, children, foodOptions }) => {
  const [modalTitle, setModalTitle] = useState("");

  useEffect(() => {
    if (typeof children === "string") {
      setModalTitle(children);
    }
  }, [children]);

  return (
    <div>
      <Modal open={isOpen} onClose={onClose} title="Carrinho">
        {isOpen && (
          <Carrinho foodOptions={foodOptions} />
        )}
      </Modal>
    </div>
  );
};

export default CheckOut;
